import logo from './logo.svg';
import './App.css';
import Register from "./pages/register/Register";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function App() {

	return (
		<Router>
			<Routes>
				<Route exact path="/">
					<Register />
				</Route>
				<Route path="/register">
					<Register />
				</Route>
			</Routes>
		</Router>

	);
}

export default App;
